import React from "react";

export default class NoteList extends React.Component {
    renderNotes() {
        const notes = Object.values(this.props.notes)
        return notes.map((n) => <div><h1>{n.title}</h1></div>);
    }

    render() {
        return(
            <div>
                { this.renderNotes() }
            </div>
        )
    }
}
